css`
  :host {
    display: flex;
    flex-direction: column;
    font-family: 'Google Sans';
  }

  main {
    margin: auto 20px;
    flex-grow: 1;
  }

  app-header {
    width: 100%;
    height: 100%;
  }

  .title {
    display: flex;
    align-items: center;
    font-size: 25px;
    width: 100%;
    padding: 30px;
  }
`

css`
    .card {
      border: 1px solid lightgray;
      background-color: white;
      margin: 10px;
      border-radius: 10px;
      font-size: 16px;
      width: 450px;
      overflow: hidden;
    }

    .cardWrapper {
      margin: 10px;
      display: flex;
      height: 250px;
      flex-direction: column;
      justify-content: space-between;
    }

    .title {
      font-size: 20px;
      margin-bottom: 17px;
    }

    .description {
      color: #5C6063;
    }

    .actionWrapper {
      display: flex;
      align-items: center;
      justify-content: space-between;
      width: 100%;
    }

    .button {
      cursor: pointer;
      background: white;
      border-radius: 50px;
      border: 2px solid #2C67FF;
      padding: 20px;
      box-shadow: 0 1px 2px #ccc;
      color: #2C67FF;
      font-size: 16px;
      font-family: 'Google Sans';
    }

    .fillButton {
      cursor: pointer;
      color: white;
      background: #2C67FF;
      border-radius: 50px;
      border: 2px solid #2C67FF;
      padding: 20px;
      box-shadow: 0 1px 2px #ccc;
      font-size: 16px;
      font-family: 'Google Sans';
    }
`

css`
    .campaignList {
      display: flex;
      align-items: center;
      justify-content: center;
      flex-wrap: wrap;
    }
`

css`
      .cloudLogo {
        height: 25px;
      }

      .cymbalGivingLogo {
        height: 100px;
      }

      .headerContainer {
        display: flex;
        align-items: center;
        justify-content: space-between;
        color: #606367;
      }

      .headerWrapper {
        display: flex;
        align-items: center;
      }

      .cloudLogoWrapper {
        display: flex;
        flex-direction: column;
      }

      .cloudLogoWrapper p {
        margin: 5px 0;
        font-size: 18px;
      }

      .banner {
        background-color: #306DFD;
        padding: 25px;
        color: white;
        font-size: 16px;
        line-height: 24px;
        display: flex;
        align-items: center;
        justify-content: center;
        text-align: center;
        box-shadow: 0 0 8px #ccc;
        margin-bottom: 10px;
      }
    `

css`
    .leftPanel,
    .rightPanel {
      width: 50%;
    }

    .about, 
    .website {
      display: flex;
      align-items: center;
      margin: 10px 0;
      border-bottom: 1px solid light-grey;
    }

    .circle {
      width: 50px;
      height: 50px;
      margin-right: 10px;
      background: linear-gradient(332.1deg, #86F7B1 14.81%, #2C67FF 62.34%);
      border-radius: 50px;
    }

    .campaignContainer {
      display: flex;
      align-items: center;
      justify-content: space-between;
      margin: 30px auto;
      font-family: "Google Sans";
      width: 100%;
    }

    .campaignWrapper {
      display: flex;
      justify-content: space-between;
      flex-wrap: wrap;
      margin: auto 30px;
      width: inherit;
    }

    table.donationTable {
      border: 1px solid lightgray;
      border-radius: 5px;
      min-width: 640px;
      margin: 10px 0;
    }

    table.donationTable .tableHeader {
      background-color: lightgray;
    }

    table.donationTable .tableHeader th {
      background-color: lightgray;
      padding: 7px;
    }

    table.donationTable tr {
      border-bottom: 1px solid lightgray;
      padding: 7px;
    }
`
